import React from "react";
import "./Login.scss";

export const Login = () => {
  return (
    <div className="Login">
      <form className="Login__Form">
        <input placeholder="Email" className="Login__Form__Input"></input>
        <div>
          <input
            placeholder="Mot de passe"
            className="Login__Form__Input"
          ></input>
          <span class="highlight"></span>
          <span class="bar"></span>
          <label>Name</label>
        </div>
      </form>
    </div>
  );
};

export default Login;
